export const AVAILABLE_BRANCHES = ["BA-BED", "CIVIL", "CSE", "ECE", "IT", "MECH", "PHARMACY"] as const;
export type BranchType = typeof AVAILABLE_BRANCHES[number];

export const getStudent = (enrlNo: string): StudentData | undefined => {
    return STUDENTS_DATA.find(s => s.EnrlNo === enrlNo);
};

export const get8thSemesterRecord = (student: StudentData): ExamRecord | undefined => {
    return student.ExamRecords[0];
};

export const getStudentsByBranchAndYear = (branch: string, year: string) => {
    return STUDENTS_DATA.filter(s => {
        return s.Details.Profile.BranchCode === branch && s.Details.Profile.FolderYear === year;
    });
};

